import "./App.css";

class App extends Component {

   render() {

return <div className="wrapper">
   <div className="form-wrapper">
<h1>Create Account</h1>

<form onSubmit={this.handleSubmit} noValidate>
<div className="firstName">
<label htmlFor="firstName">First Name</label>
<input type="text" classname="" placeholder="Type your first Name here." type="text" name="firstName" noValidate onChange={this.handleChsange} 
/>
</div>

<div className="lastName">
<label htmlFor="lastName">Last Name</label>
<input type="text" classname="" placeholder="Type your last Name here." type="text" name="lastName" noValidate onChange={this.handleChsange} 
/>
</div>

<div className="password">
<label htmlFor="password">password</label>
<input type="password" classname="" placeholder="Type your password here." type="password" name="password" noValidate onChange={this.handleChsange} 
/>
</div>

</form>
   </div>

</div>;

   }

}

export default App;
